import React, { useState } from 'react';
import './App.css'; // Import the App.css file for styling

const Header = () => {
  const [isSignup, setIsSignup] = useState(false); // Track if the user is signing up or logged in

  const toggleLoginSignup = () => {
    setIsSignup(!isSignup); // Toggle between Login and Sign Up
  };

  const handleButtonClick = (type) => {
    // Handle button click for Doctor/Patient Login or Signup
    console.log(`${type} clicked`);
  };

  return (
    <header className="header">
      {/* Logo */}
      <div className="logo">
        <img src="images/Doctro2.jpg" alt="Doctro Logo" /> {/* Placeholder logo */}
      </div>

      {/* Navigation */}
      <nav className="nav-links">
        <ul>
          <li><a href="#services">Our Services</a></li>
          <li><a href="#about">About Us</a></li>
        </ul>
      </nav>

      {/* Login/SignUp Button with Dropdown */}
      <div className="auth-buttons">
        <button className="btn" onClick={toggleLoginSignup}>
          {isSignup ? 'Sign Up' : 'Login'}
        </button>

        {/* Dropdown for Doctor/Patient */}
        {isSignup ? (
          <div className="dropdown">
            <button onClick={() => handleButtonClick('Doctor')}>Doctor</button>
            <button onClick={() => handleButtonClick('Patient')}>Patient</button>
          </div>
        ) : null}
      </div>
    </header>
  );
};

export default Header;
